import Data.List
import Data.Char

polymer :: String
polymer = ""
-- polymer = "dabAcCaCBAcCcaDA"

reduce :: String -> String
reduce []                                          = []
reduce (x:[])                                      = [x] 
reduce (x:y:xs) | toLower x == toLower y && x /= y = reduce xs
                | otherwise                        = x : reduce (y:xs)

shrink :: String -> String
shrink xs | xs == ys  = xs
          | otherwise = shrink ys
           where ys = reduce xs

removeUnit :: String -> Char -> Int
removeUnit xs x = length $ shrink $ filter (\x' -> toLower x' /= x) xs

